import React, { Component } from 'react'

import history from './history'
export default class List extends Component {

  constructor(props) {
    super(props);
    this.state = {
      inputValue: '',
      items: [],
    }
  }

  onInputChange(e) {
    this.setState({
      inputValue: e.target.value,
    });
  }

  addItem() {
    let items = this.state.items;
    items.push(this.state.inputValue);
    this.setState({
      items
    });
  }
  delItem()
  {
      let items=this.state.items;
      items.shift()
      this.setState({
          items
      })
  }

  listItems() {
    let items = this.state.items;
    return (
      <ol>
        {

          items.map((val, index) => {
            return (
              <li key={index}>

                  {val}
              </li>
            );
          })
        }
      </ol>

    );
  }
handleLogout(){
    history.push('/')
}


    render() {
        return (
            <div>
              <table>
                <th><h1>This is your Dashboard</h1></th>
                <tr></tr><input type="text" onChange={ (e) => this.onInputChange(e) } />
                <button onClick={ () => this.addItem() }>Add item</button>
                <button onClick={ () => this.delItem() }>delete item</button>
                <br/>
                { this.listItems() }
                <button onClick={(e=>this.handleLogout(e))}>logout</button>
                </table>
            </div>
        )
    }
}
